import React from 'react'

function Resume() {
  const datas = window.localStorage.getItem('obj')
  const rData = JSON.parse(datas)
  return (
    <div className='container'>
      <div className='row'>
        <div className='col-1'>
          {rData.name}
        </div>

        <div className='col-1'>

          {rData.Lastname}
        </div>


          {rData.Gail}
          {rData.Address}
          {rData.Dateofbirth}
          {rData.Qualification}
          {rData.Skills}
          {rData.Maritalstatus}
          {rData.Hobbies}


      </div>
















    </div>
  )
}

export default Resume
